What about using "_" (underscores) for very small numbers?  When I tried it, Python 3.7 seemed to accept the underscores, but when I printed the number it was printed using scientific notation. When I print the large numbers, they are printed using all the zeros (w/o underscores), but without scientific notation. Seems inconsistent to me. They should work the same way... either both displayed with scientific notation, or both written out  with all the 0's (zeros). Also, the formatted print string trick using ":," also works with big numbers, but not small numbers. Maybe I'm missing some secret like ":," that will allow me to print very small numbers with all the zeros. Any ideas?  [ I guess the other solution is to choose more appropriate units of measure; no one measures sub-atomic particles in parsecs, nor interstellar distances in angstroms. ]  Here's my code:  <code>  # Working with large numbers in Python v.3.7.  In the real world, we separate large numbers # into groups of 3-digits using comas(',') to make the large numbers easier to read, easier to # work with, and to avoid making mistakes. In Python 3.7 you can do the same thing using  # the underscore character ("_") without affecting the value of the number:  bignum1 = 10000000000000  # Quick! How many "0"s is that? bignum2 = 10_000_000_000_000  print(f"
{bignum2}
 should equal
{bignum1}
") # Use formatted print ':," to show comas (',') # in place of underscores ('_'): print(f"
{bignum2:,}
 should equal
{bignum1}
")  # Using the ternary operator... # same = True if bignum2 == bignum1 else False # print(same) # print(True if bignum2 == bignum1 else False) print(bignum2 == bignum1)  # Easier than ternary operator  # Which begs the question... # Can it work with very small numbers?  smallnum1 = .00000054321 smallnum2 = .000_000_543_21  print(f"
{smallnum2}
 should equal
{smallnum1}
") print(f"
{smallnum2:,}
 should equal
{smallnum1:,}
")  # Using the ternary operator... # same = True if smallnum2 == smallnum1 else False # print(same) # print(True if smallnum2 == smallnum1 else False) print(smallnum2 == smallnum1)  # Easier than ternary operator  # Well, Python 3.7 seems to accept underscores with very small numbers, but these  # small numbers are printed using scientific notation (e.g. 0.00000054321 is  # displayed as  5.4321e-07). Why aren't big numbers numbers also printed with # scientific notation? This seems inconsistent. # # Note: This underscore number separator feature is only available in Python  # starting with Python v3.6+. Earlier versions of Python will not have this feature.  </code>
